import Tweet from "./components/Tweet";

function App() {


    const [text, setText] = useState("Tape...")

    function handlerChange(e){
        setText(e.target.value)
    }

  return (
    <div>
        <input type="text" onChange={handlerChange}/>
        <button>Click me</button>
        <h1>{text}</h1>
        <Tweet/>
    </div>
  );
}

export default App;
